import React from 'react'

const Dashboard = () => {
  return (
    <div className='container'>
        <div>
        <button type="button" className="text-white bg-cyan-500 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">Add new ticket</button>
        </div>
    </div>
  )
}

export default Dashboard
